import React from "react";
import {Layout, Menu, Dropdown} from "antd";
import {BrowserRouter} from "react-router-dom";
import {AppstoreFilled, DownOutlined} from "@ant-design/icons";

const {Header, Content, Sider} = Layout;

const {SubMenu} = Menu;

class Frame extends React.Component {

    DownMenu = () => {
        return (
            <Menu>
                <Menu.Item key={"1"}>
                    <a>个人主页</a>
                </Menu.Item>
                <Menu.Item key={"2"}>
                    <a>退出登录</a>
                </Menu.Item>
            </Menu>
        )
    }

    render() {
        return (
            // BrowserRouter表示使用了histroy模式的路由，必须放在最外层
            <BrowserRouter>
                {/*使用顶部——侧边栏——通栏的布局*/}
                <Layout>
                    <Header className={"header"}>
                        <AppstoreFilled style={{color: "white", fontSize: "30px", marginTop: "17px", float: "left"}}/>
                        <div style={{
                            color: "white",
                            fontFamily: "微软雅黑",
                            fontSize: "25px",
                            float: "left",
                            marginLeft: "30px"
                        }}>装修小程序后台管理系统
                        </div>
                        <Dropdown overlay={this.DownMenu} trigger={["click"]}>
                            
                        </Dropdown>
                    </Header>
                    <Layout>
                        <Sider width={200} className={"site-layout-background"}>
                            <Menu mode={"inline"} defaultSelectedKeys={["1"]} defaultOpenKeys={["1"]}
                                  style={{height: "100%", borderRight: 0}}>
                                <SubMenu></SubMenu>
                            </Menu>
                        </Sider>
                        <Content>main</Content>
                        <Sider>right</Sider>
                    </Layout>
                </Layout>
            </BrowserRouter>
        );
    }
}

export default Frame;
